XYPosition pol_abs(PolarPosition pol_pos)
{
	double angle = info.self.view_angle + pol_pos.angle;
	double dy = pol_pos.distance*sin(angle*pi / 180);
	double dx = pol_pos.distance*cos(angle*pi / 180);
	return { info.self.xy_pos.x + dx,info.self.xy_pos.y + dy };
}
