bool help(XYPosition abs_pos)
{
	static int look = 2;
	static int ID = 100;
	double angle = abs_pol(abs_pos).angle;
	XYPosition aim = abs_pos;
	angle += info.self.view_angle;
	if (angle < 0)angle += 360;
	if (angle > 360) angle -= 360;
	if (look == 2) { block_move(abs_pos, angle); look = 1; }
	else if (look == 1)
	{
		for (int i = 0; i < info.others.size(); i++)
		{
			if (abs_pol(pol_abs(info.others[i].polar_pos), aim).distance && fri_ene(info.others[i].player_ID)) { ID = info.others[i].player_ID; break; }
		}look = 0;
	}
	else if (abs_pol(aim).distance < PICKUP_DISTANCE && !info.self.attack_cd)
	{
		for (int i = 0; i < info.others.size(); i++)
		{
			if (info.others[i].player_ID == ID) aim = pol_abs(info.others[i].polar_pos);
		}
		bool firstaidcase = 0;
		for (int i = 0; i < info.self.bag.size(); i++)
		{
			if (info.self.bag[i].type == 16) { firstaidcase = 1; break; }
		}
		if (firstaidcase) { shoot(FIRST_AID_CASE, abs_pol(aim).angle, ID); }
		else shoot(BONDAGE, abs_pol(aim).angle, ID);

		return 1;
	}
	else { block_move(aim); return 0; }
}
