bool view_pickup()
{
	static int ID = -1;
	int flag = 0;
	if (!info.items.empty())
		for (int i = 0; i < info.items.size(); i++)
		{
			if (info.items[i].polar_pos.distance < 1 && info.items[i].type != CODE_CASE) { pickup(info.items[i].item_ID, -1); flag = 1; break; }
		}
	if (!flag)
	{
		double minidistance = 1000;
		for (int i = 0; i < info.items.size(); i++)
		{
			if (info.items[i].polar_pos.distance < minidistance && info.items[i].type != CODE_CASE && !point_block(pol_abs(info.items[i].polar_pos)) && !point_block({ pol_abs(info.items[i].polar_pos).x + 1, pol_abs(info.items[i].polar_pos).y }) && !point_block({ pol_abs(info.items[i].polar_pos).x, pol_abs(info.items[i].polar_pos).y + 1 }) && !point_block({ pol_abs(info.items[i].polar_pos).x + 1, pol_abs(info.items[i].polar_pos).y + 1 })) { flag = i + 1; minidistance = info.items[i].polar_pos.distance; }
		}
		block_move(pol_abs(info.items[flag - 1].polar_pos));
	}
	return flag;
}
