bool need_pickup()
{
	NEED selfitem;
	for (int i = 0; i < info.self.bag.size(); i++)
	{
		if (info.self.bag[i].type <= 9 && info.self.bag[i].type != 0) selfitem.bullet += info.self.bag[i].durability;
		if (info.self.bag[i].type == 6 || info.self.bag[i].type == 7) selfitem.sniper += info.self.bag[i].durability;
		if (info.self.bag[i].type == 9) selfitem.crossbow += info.self.bag[i].durability;
		if (info.self.bag[i].type >= 10)selfitem.xweapon[info.self.bag[i].type - 10] += info.self.bag[i].durability;
	}
	bool need[21] = { 0 };
	if (selfitem.bullet < item_need[info.self.vocation].bullet) for (int i = 0; i < 10; i++) need[i] = 1;
	if (selfitem.sniper < item_need[info.self.vocation].sniper) { need[6] = 1; need[7] = 1; }
	if (selfitem.crossbow < item_need[info.self.vocation].crossbow) need[9] = 1;
	for (int i = 10; i < 21; i++) if (selfitem.xweapon[i - 10] < item_need[info.self.vocation].xweapon[i - 10]) need[i] = 1;
	int flag = 0;
	for (int i = 0; i < info.items.size(); i++)
	{
		if (info.items[i].polar_pos.distance < 1 && need[info.items[i].type] == 1) { pickup(info.items[i].item_ID, -1); flag = 1; break; }
	}
	if (!flag)
	{
		double minidistance = info.items[0].polar_pos.distance;
		for (int i = 0; i < info.items.size(); i++)
		{
			if (info.items[i].polar_pos.distance < minidistance && need[info.items[i].type] == 1) { flag = i; minidistance = info.items[0].polar_pos.distance; }
		}
		block_move(pol_abs(info.items[flag].polar_pos));
		flag = 1;
	}
	return flag;
}
