int enemyinfo_revise(OtherInfo x, int d = 0)
{
	if (fri_ene(x.player_ID)) return 0;
	int j;
	for (j = 0; j < enemynum; j++)
		if (x.player_ID == enemy[j].ID)
		{
			int d = enemy[j].delay;
			enemy[j].ID = x.player_ID;
			if (x.vocation != VOCATION_SZ) enemy[j].vocation = x.vocation;
			enemy[j].delay = d;
			if (x.status != ON_PLANE)enemy[j].status = x.status;
			enemy[j].abs_pos = pol_abs(x.polar_pos);
			if (x.move_angle >= 0)enemy[j].move_angle = x.move_angle;
			return d;
		}
	if (j == enemynum)
	{
		enemynum++;
		enemy[j].ID = x.player_ID;
		if (x.vocation != VOCATION_SZ) enemy[j].vocation = x.vocation;
		enemy[j].delay = d;
		if (x.status != ON_PLANE)enemy[j].status = x.status;
		enemy[j].abs_pos = pol_abs(x.polar_pos);
		if (x.move_angle >= 0)enemy[j].move_angle = x.move_angle;
	}
	return 9999;
}
