XYPosition aim_find()
{
	XYPosition center = info.poison.next_center;
	XYPosition Aim = center;
	double min_distance = 100000;
	double r = info.poison.next_radius - 10; if (r < 0) r = 0;
	for (int i = 0; i < 30; i++)
	{
		XYPosition aim = { center.x + cos(i * pi / 15) * r , center.y + sin(i * pi / 15) * r };
		landform_pos aimland = aimland.abs_landpos(aim);
		if (!point_block(aim))
		{
			double total_distance=0;
			for (int j = 0; j < enemynum; j++)
			{
				if (enemy[j].delay < 30) total_distance += abs_pol(enemy[j].abs_pos, aim).distance *sqrt(900 - enemy[j].delay*enemy[j].delay);
			}
			for (int j = 0; j < soundnum; j++)
			{
				total_distance += abs_pol(ukenemy[j].abs_pos, aim).distance *0.5 *sqrt(400 - ukenemy[i].delay);
			}
			if (total_distance < min_distance) { min_distance = total_distance; Aim = aim; }
		}
	}
	return Aim;
}
